import image1 from "../assets/img2.jpg"
import image2 from "../assets/img3.jpg"
import image3 from "../assets/img1.jpeg"
import image4 from "../assets/img4.jpg"

const FollowersData=[
    {
        name:"Fatima Amjad",
        image:image1,
    },
    {
        name:"Laila Zaimi",
        image: image2,
    },
    {
        name:"Ibrahim Sabri",
        image:image3,
    },
    {
        name:"Salma Chahid",
        image: image4,
    },
]
export default FollowersData;
